import Navbar from "./Navbar";



const Home = () => {
 const [movies,setMovies]=useState([])
  const API=`http://www.omdbapi.com/?apikey=a1848174&s=titanic`
  useEffect(()=>{
   fetch(API)
   .then((response)=>response.json())
   .then((data)=>console.log(data.Search))
    

  },[])
   
  return (
    <>
    
    <Navbar/>
  
    

    </>
  );
}

export default Home;
